def nestedMongKafkaJsonToList(nested):
    '''
    ÈÄíÂΩíÊàñËé∑Âèñ key ÊòØName„ÄÅValueÁöÑÂÄº
    :param nested:
    :return:
    '''
    if isinstance(nested["Value"],list) :
         # print("---------->11",nested["Value"])
         if  len(nested["Value"]) != 0:
            for val in nested["Value"]:
                # print("---",val)
                if isinstance(val,list):
                    for i in val:
                        # print(i)
                        if isinstance(i["Value"],list):
                            if len(i["Value"]) != 0:
                                yield from nestedMongKafkaJsonToList(i)
                        else:
                            yield from nestedMongKafkaJsonToList(i)
                elif isinstance(val,abc.Mapping):
                    yield from nestedMongKafkaJsonToList(val)
    else:
        for key, value in nested.items():
            if isinstance(value, list) and isinstance(value[0],abc.Mapping):
                for val in value:
                    yield from nestedMongKafkaJsonToList(val)

            elif isinstance(value, list) and isinstance(value[0], list) :
                for i in value[0]:
                    if isinstance(i["Value"],list) and  len(i["Value"]) ==0:
                        pass
                    else:

                        for va in  nestedMongKafkaJsonToList(i):
                            print("-----------------------------error-------")
            else:
                yield value

def handleDetailsKeyData(string,operationType = "insert"):
    '''
    Áî®‰∫éÂ§ÑÁêÜ keyÊòØData‰∏≠ÁöÑÂÄº
    :param string:
    :return: ËøîÂõûÂÄº [{},{},{}]
    '''
    delKey = ["NewGroupNum_List","Json","chatmes"]
    KeyMergeValue = ["DelGroupNum_List","affectedusers"]
    KeyResetName = ["Area"]
    maxNum = 0
    totalList = []
    tmpTotalList = []
    tmpOtherList = []
    totalDictInsertList = []

    #ÈÄíÂΩí Ëé∑ÂèñdictÁöÑvalue
    if operationType == "insert":
        data = string
    elif operationType == "update":
        data = string["Value"]

    for i in data:
        # print("----------xxxxx--------", i)
        if i["Name"] not in delKey:
            count = 1
            for val in nestedMongKafkaJsonToList(i):

                if i["Name"] in KeyMergeValue: # Êää [groupid:1,groupid:2,groupid:3] Êûö‰∏æÁ±ªÂûãÁöÑÂêàÂπ∂
                    if count%2 != 0:
                        val = i["Name"] + "_" + val
                        # print(val)
                    tmpOtherList.append(val)
                    count +=1
                elif i["Name"] in KeyResetName:
                    if count % 2 != 0:
                        val = i["Name"] + "_" + val
                        # print(val)
                    tmpTotalList.append(val)
                    count += 1
                else:
                    tmpTotalList.append(val)

    #dict ÂÄºÂêàÂπ∂
    if len(tmpOtherList) != 0 :
        xx = str([tmpOtherList[i] for i in range(len(tmpOtherList)) if i%2 != 0]).replace("[","").replace("]","")
        tmpTotalList.append(tmpOtherList[0])
        tmpTotalList.append(xx)

    num = [x for x in range(len(tmpTotalList)) if x%2 == 0]
    for i in num:
        totalDictInsertList.append({tmpTotalList[i]:tmpTotalList[i+1]})

    keyList = [k for val in totalDictInsertList for k in val]
    #keyList ÂÄºÂéªÈáç
    notDuplicationKeyList = list(dict.fromkeys(keyList)) #Âà©Áî®dictÁöÑ ‰∏çÂèØÈáçÂ§çÊÄß

    tmpCommKeyDict = {}
    tmpMulKeyDict = {}
    for val in notDuplicationKeyList:
        tmpList = [index for index in range(len(keyList)) if keyList[index] == val]
        if len(tmpList) == 1:
            tmpCommKeyDict.update(**totalDictInsertList[tmpList[0]])
        else:
            tmpMulKeyDict.update({val:tmpList})

    if len(tmpMulKeyDict) == 0 :
        tmpCommKeyDict = handleStringJson(tmpCommKeyDict) #ÈúÄË¶ÅÂ§ÑÁêÜÂ≠óÂÖ∏valueÁöÑÂÄºÊòØstringÁ±ªÂûãÔºåstringÁöÑÂÜÖÂÆπÊòØjson ÔºåËß£Êûêjson
        totalList.append(tmpCommKeyDict)
        # print("------------------------------22",totalList)
        # return  totalList.append(tmpCommKeyDict)
    elif len(tmpMulKeyDict) == 1 :
        for k,v in tmpMulKeyDict.items():
            tmpCommKeyDict.update(**totalDictInsertList[v[0]])
            totalList.append(tmpCommKeyDict)
            # print("------------------------------23",totalList)
            # return  totalList.append(tmpCommKeyDict)
    else:
        for key, val in tmpMulKeyDict.items():
            num =  len(val)
            if num > maxNum:
                maxNum = num

        for i in range(maxNum):
            tmpDict = {}
            for key,val in tmpMulKeyDict.items():
                tmpDict.update(tmpCommKeyDict,**totalDictInsertList[val[i]])

            totalList.append(tmpDict)
    return totalList

